import React, { Component } from 'react';
import './Footer.css';

class Footer extends Component{

    render() {
        return(
        <div classNameName="container">
            <div classNameName="row">
                <div className="col-md-10 col-lg-8 mx-auto">
                    <ul className="list-inline text-center">
                        <li className="list-inline-item"><a href="https://www.instagram.com/chinese.association.linton/" target="_blank"><span className="fa-stack fa-lg"><i className="fa fa-circle fa-stack-2x"></i><i className="fa fa-instagram fa-stack-1x fa-inverse"></i></span></a></li>
                        <li className="list-inline-item"><a href="https://www.facebook.com/LUC-Chinese-Association-%E6%9E%97%E7%99%BB%E5%8D%8E%E6%96%87%E5%AD%A6%E4%BC%9A-375021519914630" target="_blank"><span className="fa-stack fa-lg"><i className="fa fa-circle fa-stack-2x"></i><i className="fa fa-facebook fa-stack-1x fa-inverse"></i></span></a></li>
                    	<li className="list-inline-item"><a href="mailto:chineseasscociation@ktg.edu.my?Subject=林登华文学会" target="_top"><span className="fa-stack fa-lg"><i className="fa fa-circle fa-stack-2x"></i><i className="fa fa-envelope-o fa-stack-1x fa-inverse"></i></span></a></li>

					</ul>
                    <p className="text-muted copyright">Copyright&nbsp;©&nbsp;<a href="https://www.facebook.com/LUC-Chinese-Association-%E6%9E%97%E7%99%BB%E5%8D%8E%E6%96%87%E5%AD%A6%E4%BC%9A-375021519914630/" target="_blank">LUC Chinese Association 林登华文学会&nbsp;</a>2020</p>
                    <p className="text-muted copyright">Developed by <a href="https://hovahyii.github.io/portfolio-v2/" target="_blank">Hovah</a></p>
                </div>
            </div>
        </div>
        )
    }
}

export default Footer
